import { Box, Modal, } from '@mui/material';
import React from 'react'

function AddProduct({open}) {
    const style = {
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: 400,
        bgcolor: 'background.paper',
        border: '2px solid #000',
        boxShadow: 24,
        p: 4,
      };
  return (
    <div><Modal
    open={open}
    
  >
    <Box sx={style}>
      
    </Box>
  </Modal></div>
  )
}

export default AddProduct
